USE streaming;



CREATE TABLE streaming. movies (
  movie_id INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  title VARCHAR(100) NOT NULL,
  release_year DATETIME (100) NULL,
  genre VARCHAR(100) NULL,
  director VARCHAR(100) NULL,
  duration VARCHAR(10000) NULL
);
  
  
  CREATE TABLE streaming. users (
	user_id INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
    user_firstname VARCHAR(45) NOT NULL,
    user_lastname VARCHAR(45) NOT NULL,
    user_email VARCHAR(100) NOT NULL,
    subscription_id INT NOT NULL,
    subscription_date DATETIME NOT NULL,
    CONSTRAINT subscription_id_subscriptions_usersFK
	FOREIGN KEY (subscription_id)
	REFERENCES streaming.subscriptions (subscription_id)
	ON DELETE CASCADE
	ON UPDATE CASCADE
);


CREATE TABLE streaming . watch_history (
	user_id INT NOT NULL,
    latest_watch VARCHAR(100) NOT NULL,
    date_watched DATETIME,
    CONSTRAINT user_id_users_watch_historyFK
	FOREIGN KEY (user_id)
	REFERENCES user_id.users (user_id)
	ON DELETE CASCADE
	ON UPDATE CASCADE
);
    

CREATE TABLE streaming. ratings (
	review_id INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
    movie_id INT NOT NULL, 
	review_rating INT NOT NULL,
    CONSTRAINT movie_id_movies_ratingsFK
	FOREIGN KEY (subscription_id)
	REFERENCES streaming.subscriptions (subscription_id)
	ON DELETE CASCADE
	ON UPDATE CASCADE

);



CREATE TABLE streaming. subscriptions (
	subscription_id INT PRIMARY KEY NOT NULL,
    subscription_tier VARCHAR(50) NOT NULL
);


